You stumble upon an odd looking bottle in the middle of a field. As soon as you open the top, there is a flash of white, blinding light and a beautiful woman appears before you: &quot;Thank you so much for setting me free! I can't tell you how long I've been stuck in that bottle. I'm so grateful that I will grant you any three wishes you want...but...I do have a favor to ask first. You see, it has been more than a century since I've seen a man. I have needs...needs that must be satisfied...&quot;

As the genie crosses her arms and quickly nods her head, the both of you are magically teleported inside of her bottle: &quot;We're here...this is my home, how do you like it? Now, down to business - I'm assuming you don't mind me using your body for sexual pleasure, do you? It's the least you can do for me, considering I'm granting you so many wishes. No? How dare you refuse a genie. No matter, I have something that will change your mind...&quot;

The genie blinks again and suddenly you find yourself tied down to her bed... &quot;You look much better tied up. The wonderful thing about you mortal men is how little control you have over your cocks, I don't need magic to make you hard... Oooh yes, one hundred years of abstinence has created such sexual tension...I am going to wear you out...&quot;
